"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?23/48/24326?source=related_link\">",
"      Primary humoral immune deficiencies: An overview",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?41/30/42471?source=related_link\">",
"      Severe combined immunodeficiency (SCID): An overview",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?0/0/10?source=related_link\">",
"      Severe combined immunodeficiency (SCID): Specific defects",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?39/22/40295?source=related_link\">",
"      Syndromic immunodeficiencies",
"     </a>",
"    </li>",
"   </ul>",
"  </div>",
