" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Stings of imported fire ants: Clinical manifestations, diagnosis, and treatment",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?7/51/7994/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?7/51/7994/contributors\">",
"     Richard D deShazo, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?7/51/7994/contributors\">",
