var title_f7_51_7995="Caveats";
var content_f7_51_7995=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F72133&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F72133&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Caveats re intervention",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td>",
"       &bull; Do not succumb to your instinct to avoid the issue (Conspiracy of Silence).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Intervention is worth it. Coercion works!",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; The initial anger is later replaced with gratitude.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Job is the last to go. When the symptoms of addiction spill into the workplace, the addiction is advanced and the symptoms identified are only the tip of the iceberg.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Their life will be better. Treatment has a high success rate for physicians.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Confidentiality can usually be maintained.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; The physician's career will be maintained. Outcome studies demonstrate that most physicians return to practice.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Do not do this alone. Help is available.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
