var title_f7_51_7996="CLIP score for HCC";
var content_f7_51_7996=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F69726&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F69726&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    CLIP (Cancer of the Liver Italian Program) scoring system for hepatocellular cancer",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Variable",
"       </td>",
"       <td class=\"subtitle1\">",
"        Score",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Child-Pugh stage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        A",
"       </td>",
"       <td>",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        B",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        C",
"       </td>",
"       <td>",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Tumor morphology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Uninodular and extension &le;50 percent",
"       </td>",
"       <td>",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Multinodular and extension &le;50 percent",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Massive or extension &gt;50 percent",
"       </td>",
"       <td>",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Alpha-fetoprotein",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &lt;400",
"       </td>",
"       <td>",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &ge;400",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Portal vein thrombosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        No",
"       </td>",
"       <td>",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Yes",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The Cancer of the Liver Italian Program (CLIP) score has been used to predict survival in patients with hepatocellular carcinoma. The total score is derived by adding each of the subscores. In one study, median survival was 36, 22, 9, 7, and 3 months for patients in CLIP categories 0, 1, 2, 3, and 4 to 6, respectively.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Prospective validation of the CLIP score: A new prognostic system for patients with cirrhosis and hepatocellular carcinoma. Hepatology 2000; 31:840. Copyright &copy; 2000 Elsevier Science.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
